#https://leetcode-cn.com/problems/largest-submatrix-with-rearrangements/
#整列的调整，先将输入转换为列的数组
#动态规划，求解每个子问题的最优解

class Solution(object):
    def largestSubmatrix(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        """

        largestMatrix = 0
        #转置矩阵
        lenRow = len(matrix[0])
        matrixZ = []

        for index in range(lenRow):
            temp = []
            matrixZ.append(temp)
    
        for item in matrix:
            for index in range(len(item)):
                matrixZ[index].append(item[index])

        #用宽度为1 to len()的矩阵去套，到宽度N不能再组成SUB 矩阵的时候，就跳出，迭代过程中记录下最大值
        #比如 如果宽度为2   则以2为宽度  平移着，去套整个MATRIX，记录每个平移下的连续11数量 * 2 = nums
        for width in range(1, len(matrixZ[0]) + 1):
            find = False
            for startIndex in range(len(matrixZ[0]) + 1 - width):
                nums = 0
                for item in matrixZ:
                    if 0 not in item[startIndex : startIndex + width]:
                        nums += 1
                total = nums * width

                if nums > 0:
                    find = True

                if total > largestMatrix:
                    largestMatrix = total
            
            if find == False:
                break

        return largestMatrix

